import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputs: {
    borderWidth: 1,
    borderColor: 'green',
    borderRadius: 10,
    padding: 10,
    textAlign: 'center',
    marginBottom: 5,
    margin: 15,
    placeholderTextColor: 'darck-gray',
  },
  buttons: {
    padding: 10,
    borderRadius: 10,
    width: 150,
    marginTop: 20
  },
  textbuttons: {
    color: 'white',
    textAlign: 'center',
    fontSize: 25
  }
});

export { styles }
